import React from "react";
import './Movies.css';


function Bookingpage() {
    const date = new Date();
    const showTime = date.getHours() 
        + ':' + date.getMinutes() 
        + ":" + date.getSeconds();
 
    return (
        <div className="App">
            <h1 align="center">Current Time</h1>
            <h2 align="center"> {showTime}</h2>
        </div>
    );

}
